import './App.css';
import Form from './components/login/Form';
import {
  BrowserRouter as Router,
  Route,
  Routes,
  Navigate
} from "react-router-dom";
function App() {
  return (
    <Router>
    <Routes>
    <Route  path="/" element={ user?<Navigate to="/"/>:<Register/>}/>
    </Routes>
    </Router>
  );
}

export default App;
